import React from 'react'
import InnerHtml from 'dangerously-set-html-content'

export class Badges extends React.Component {
    render() {
        const edt = `
            <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="5a30a12d-5919-4d91-b8a1-882d8f13cbb1" data-share-badge-host="https://www.credly.com"></div><script type="text/javascript" async src="//cdn.credly.com/assets/utilities/embed.js"></script>
        `

        return (
            <div className="card rounded body-color mt-4">
                <div className="card-header header-color">certifications and badges</div>
                <div className="card-body">
                    <InnerHtml html={badges.edt}></InnerHtml>
                </div>
            </div>
        );
    }
}
